import React from "react";
import Typical from "react-typical";

const Logo = (props) => {
  return (
    <div className={props.style}>
      <h2>
        Hi! I am Xinyu Tang, aspiring{","}
        <Typical
          loop={Infinity}
          wrapper="b"
          steps={["web developer", 1000, "software engineer", 1000]}
        />
      </h2>
    </div>
  );
};

export default Logo;
